import {Sidebar,Header,TaskList} from './index'

const Reminder = () =>{
  const titles = [
    'a',
    'i',
    'u',
    'e',
    'o'
  ]
  return(
    <>
    <Header/>
    {titles.map(
      (title) => {
        <Sidebar title={title}/>
      }
    )}
    <TaskList/>
    </>
  )
}

export default Reminder;
